import 'bootstrap/dist/css/bootstrap.min.css';
import React, {Fragment} from "react";


const ListTodo = () =>
{
    return (
        <div className="container">
            <table class="table">
                <thead>
                <tr>
                    <th>Description</th>
                    <th>Edit</th>
                    <th>Delete</th>
                </tr>
                </thead>
            </table>
        </div>
    )
}

export default ListTodo;
